ngLink:"youtube.com/watch?v=-CmadmM5cOk",songImg:"https://lastfm.freetls.fastly.net/i/u/770x0/fef568d02a608331391dd3365c44ff2f.jpg"}];export var Jubin=[{songName:"Raataan Lambiyan ",cName:"Jubin",songLink:"https://www.youtube.com/watch?v=gvyUuxdRdR4",songImg:"https://statushb.com/upload/post_thumbnail/raatan.jpg"},{songName:"Lut Gaye",cName:"Jubin",songLink:"https://www.youtube.com/watch?v=sCbbMZ-q4-I",songImg:"https://wallpaperaccess.com/full/5604573.jpg"},{songName:"Tum Hi Aana",cName:"Jubin",songLink:"https://www.youtube.com/watch?v=tLqtnGLfm4Q",songImg:"http://a10.gaanacdn.com/images/song/83/28861283/crop_480x480_1574920356.jpg"},{songName:"Khushi Jab Bhi",cName:"Jubin",songLink:"https://www.youtube.com/watch?v=c7mWC6CN7kY",songImg:"https://i.pinimg.com/736x/2e/f0/e6/2ef0e675aabdb323c294fdfd30cefb18.jpg"},{songName:"Bewafa Tera Masoom Chehra",cName:"Jubin",songLink:"https://www.youtube.com/watch?v=sMoM0fYO-Qg",songImg:"https://wallpapercave.com/wp/wp8233303.jpg"},{songName:"Akh Lad Jaave",cName:"Jubin",songLink:"https://www.youtube.com/watch?v=Db5xeR6HlEU",songImg:"https://m.media-amazon.com/images/M/MV5BYjNlYmI2MzItYjI2ZS00ZDk1LTljZjQtZDFlNWUxZGI3MzFjXkEyXkFqcGdeQXVyNjE0ODc0MDc@._V1_FMjpg_UX1000_.jpg"},{songName:"Meri Aashiqui",cName:"Jubin",songLink:"https://www.youtube.com/watch?v=SVjkxdjivts",songImg:"https://m.media-amazon.com/images/M/MV5BMmZkNGZkOWYtNmU4Ni00NGZkLTgzNDQtNjI0MzlhOTk3ZTQwXkEyXkFqcGdeQXVyMTE2MTc3MzU1._V1_.jpg"},{songName:"Kinna Sona",cName:"Jubin",songLink:"https://www.youtube.com/watch?v=7lfFZs50JHM",songImg:"https://m.media-amazon.com/images/M/MV5BMmFjM2IyYTktNmJiYy00MDE1LWFhMmEtODQ4OWNmYjJlZjY3XkEyXkFqcGdeQXVyMTE0NTU0MTU5._V1_.jpg"},{songName:"Tujhe Kitna Chahein Aur Hum",cName:"Jubin",songLink:"https://www.youtube.com/watch?v=h7gyJRWrjbg",songImg:"https://i.ytimg.com/vi/92J9p0VplTo/maxresdefault.jpg"}];export var Pitinfo=[{name:"Pitbull Rapper",info:"Armando Christian P\xE9rez, known by the stage name Pitbull or\nMr. Worldwide, is an American rapper. His first recorded\nmainstream performance was on a solo track from Lil Jon's\n2002 album Kings of Crunk. In 2004, Pitbull released his\ndebut album M.I.A.M.I. under TVT Records. It included\nproduction producers Lil Jon and Jim Jonsin. Pitbull later\nreleased his second album El Mariel, in 2006 and his third,\nThe Boatlift, in 2007. His fourth album, Rebelution (2009),\nincluded his breakthrough hit single \"I Know You Want Me\n(Calle Ocho)\", which peaked at number two on the US\nBillboard Hot 100.\n",image:"https://c4.wallpaperflare.com/wallpaper/780/431/651/rapper-top-music-artist-and-bands-singer-pitbull-wallpaper-preview.jpg",alt:"Pitbull"}];export var Jeniferinfo=[{name:"Jennifer Lopez",info:"Jennifer Lopez, in full Jennifer Lynn Lopez, byname J.Lo, (born July 24, 1969, Bronx, New York, U.S.), American actress and musician who began appearing in films in the late 1980s and quickly became one of the highest-paid Latina actresses in the history of Hollywood. She later found crossover success in the music industry with a series of pop albums.",image:"https://vistapointe.net/images/jennifer-lopez-wallpaper-5.jpg",alt:"Jenifer"}];export var Radfooinfo=[{name:"Stefan Kendal Gordy",info:"Redfoo cited Michael Jackson and Madonna as the group's two greatest influences. LMFAO is also influenced by a vast range of other artists, including rappers Tupac Shakur and Snoop Dogg, hip hop groups Black Eyed Peas, Run D.M.C. and the Wu-Tang Clan, R&B artist James Brown and rock bands The Beatles, Led Zeppelin, and Steel Panther as well as DJ AM, who helped introduce them to the electronic music scene. The Australian dance style the Melbourne Shuffle features heavily in the \"Party Rock Anthem\" videoclip, fused with US hip-hop dance elements. In 2007, LMFAO attended the Winter Music Conference in Miami, Florida, which the duo says was an experience that inspired their musical and creative style.",image:"https://c4.wallpaperflare.com/wallpaper/783/381/150/band-music-lmfao-wallpaper-preview.jpg",alt:"Radfoo"}];export var Marooninfo=[{name:"Maroon 5",info:"Maroon 5 is an American pop rock band from Los Angeles, California. It currently consists of lead vocalist Adam Levine, keyboardist and rhythm guitarist Jesse Carmichael, lead guitarist James Valentine, drummer Matt Flynn, keyboardist PJ Morton and multi-instrumentalist and occasional bassist Sam Farrar. Original members Levine, Carmichael, bassist Mickey Madden, and drummer Ryan Dusick first came together as Kara's Flowers in 1994, while they were still in high school.",image:"https://jasoninhollywoodland.files.wordpress.com/2010/09/maroon-5-hands-all-over-fanmade.jpg",alt:"Maroon"}];export var Alexandrainfo=[{name:"",info:"Alexandra Ioana Stan (born 10 June 1989) is a Romanian singer-songwriter. Born in the city of Constan\u021Ba, she made her worldwide breakthrough with the 2010 single \"Mr. Saxobeat\", which was written and produced by Marcel Prodan and Andrei Nemirschi. They had previously discovered Stan at a karaoke bar in 2009 and signed her to their label, Maan Records. \"Mr. Saxobeat\" had followed the singer's debut single, \"Lollipop (Param Pam Pam)\" (2009), which brought her moderate fame in Romania. \"Mr. Saxobeat\" quickly achieved commercial success locally and abroad, reaching number one in several countries and gathering various certifications. Saxobeats, Stan's debut studio album, was released in August 2011 and features the follow-up singles \"Get Back (ASAP)\" (2011) and \"Lemonade\" (2012), which had moderate success in Europe.",image:"https://lastfm.freetls.fastly.net/i/u/770x0/b65b371313db48ffacf8cfcbe2220d41.jpg",alt:"Alexandra"}];export var Akcentinfo=[{name:"Akcent",info:"Akcent  is a multi-certified, award-winning Romanian dance pop act whose members sing in Romanian, English, Polish and Spanish. Their name originated as a wordplay on accent, although it is pronounced like the English word, ascent, without the velar consonant /k/. The group was created by Adrian S\xEEn\u0103, and Ramona Barta. Their first single \"Nu-mi pas\u0103 de nimeni\" (\"I don't care about anyone\") received positive reactions from critics and became the reason Catalin Muraru signed them to Roton in 1999. They released their debut album Senzatzia in 2000. Except for the first track, \"Ultima vara\", which received some airplay, the album was a commercial failure and the band disbanded. Soon after, S\xEEn\u0103 brought Marius Nedelcu, Mihai Gruia and Sorin Brotnei into the group, changing it from a duo to a boyband. They came to prominence once with the release of their hit single \"Ti-am promis\".",image:"https://wallpapercave.com/wp/wp2355846.jpg",alt:"Akcent"}];export var Daddyinfo=[{name:"Ram√≥n Luis Ayala Rodr√≠guez",info:"Ram\xF3n Luis Ayala Rodr\xEDguez (born February 3, 1976),[2][5][6] known professionally as Daddy Yankee, is a Puerto Rican rapper, singer and songwriter. He is known as the \"King of Reggaet\xF3n\" by music critics and fans alike.[7] Daddy Yankee is the artist who coined the word reggaeton in 1994 to describe the new music genre that was emerging from Puerto Rico that synthesized American hip-hop, Latin Caribbean music, and Jamaican reggae rhythms with Spanish rapping and singing.[8][9] He is often cited as an influence by other Latin urban performers.",image:"https://mocah.org/uploads/posts/554677-daddy-yankee.jpg",alt:"Daddy"}];export var Kishorinfo=[{name:"Kishore Kumar",info:"Kishore Kumar (born Abhas Kumar Ganguly (About this soundpronunciation (help\xB7info)) 4 August 1929 13 October 1987) was an Indian playback singer and actor. He is widely regarded as one of the greatest singers in the history of Indian music. He was one of the most popular singers in the Indian film industry and from soft numbers to peppy tracks to romantic moods, Kumar sang in different genres[8] but some of his rare compositions which were considered classics were lost in time. Though Kumar was not formally trained in classical music, he could sing Bhajans,Ghazals  and Semi-Classical songs. According to Ashok Kumar, Kumar's success came because his voice hit the microphone straight at its most sensitive point.Kumar's versatility lies in the fact that he could sing songs in different voices(including the female voice).",image:"https://images.hindustantimes.com/rf/image_size_640x362/HT/p2/2016/10/12/Pictures/thursday-streamed-celebrate-versatile-birthday-meaning-legendary_3b7b3dc6-9086-11e6-b1ee-4de56c7571da.jpg",alt:"Kishore Kumar"}];export var Charlieinfo=[{name:"Charlie Puth",info:"Charles Otto Puth Jr. ( born December 2, 1991) is an American singer, songwriter, and record producer. His initial exposure came through the viral success of his song videos uploaded to YouTube.\n\n    After initially signing with eleveneleven after performing on The Ellen DeGeneres Show, Puth began contributing to songs and albums for other artists, as well as creating lite solo material and covers of popular songs. With primary intent on a solo career, Atlantic Records and Artist Partner Group eventually sought the artist and released his debut single, \"Marvin Gaye\" (featuring Meghan Trainor), in 2015.His next single and first feature, \"See You Again\", which he co-wrote, co-produced, and performed with Atlantic label-mate Wiz Khalifa for the Furious 7 soundtrack as a tribute to actor Paul Walker. It peaked at number one on the US Billboard Hot 100 for 12 non-consecutive weeks. After the success of \"See You Again\", he gained worldwide recognition for multiple subsequent releases, including his next single, \"One Call Away\". The single reached number 12 on the Billboard Hot 100.",image:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS65oWcuv8xN52QhHIjMFl0A1RKCxJSSL3wzYCWPqdxlVMkJVZzZOy1zhplnqiSNCxydWs&usqp=CAU",alt:"Charlie Puth"}];export var Brunoinfo=[{name:"Peter Gene Hernandez",info:"Peter Gene Hernandez (born October 8, 1985), known professionally as Bruno Mars, is an American singer, songwriter, record producer, musician, and dancer. He is known for his stage performances, retro showmanship, and for performing in a wide range of musical styles, including pop, R&B, funk, soul, reggae, disco, and rock. Mars is accompanied by his band, the Hooligans, who play a variety of instruments, such as electric guitar, bass, piano, keyboards, drums, and horns, and also serve as backup singers and dancers.",image:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTVw_HegaTDGwRQLyy8Tefx4GH4WBJO23tRvtHITY9W-Vm-Tza2Bz6Edu5hGvzU6fWSj4g&usqp=CAU",alt:"Peter Gene Hernandez"}];export var Taylorinfo=[{name:"Taylor Swift",info:"Taylor Alison Swift (born December 13, 1989) is an American singer-songwriter. Her discography spans multiple genres, and her narrative songwriting, which is often inspired by her personal life, has received widespread media coverage and critical praise. She is one of the best-selling musicians of all time, having sold over 200 million records worldwide.\n    Born in West Reading, Pennsylvania, Swift relocated to Nashville, Tennessee, at the age of 14 to pursue a career in country music. She signed a songwriting deal with Sony/ATV Music Publishing in 2004 and a recording deal with Big Machine Records in 2005, and released her eponymous debut studio album in 2006.",image:"https://wallpaperaccess.com/full/182792.jpg",alt:"Taylor Swift"}];export var Jubininfo=[{name:"Jubin Nautiyal",info:"Jubin Nautiyal (born 14 June 1989) is an Indian playback singer and performer. He was awarded Upcoming Male Vocalist of the Year at 8th Mirchi Music Awards for his song \"Zindagi Kuch Toh Bata (Reprise)\" from Bajrangi Bhaijaan. He also won the Rising Musical Star Award (2015) at Zee Business Awards. He has since recorded songs for films in various Indian languages, predominantly Hindi, and has established himself as one of the most sensational singers in India.",image:"https://wallpapercave.com/wp/wp8847912.jpg",alt:"Jubin Nautiyal"}];

